import React, { useState } from "react";
import { socket, initSocket } from "./socket";

initSocket();

export default function Medium() {
	const [currentNumber, setNumber] = useState(null);

	socket.on("firstNumber", (num) => setNumber(num));
	return (
		<div>
			<h1>{currentNumber}</h1>
		</div>
	);
}
